import './App.css';
import React, { Component } from 'react';
import Ingredient from './components/ingredient'
import FreezeBee from './components/freezebee';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Fabrication from './components/fabrication';

class App extends Component {
  render() {
    return (
      <Router>          
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <ul className="navbar-nav mr-auto">
              <li><Link to={'/ingredient'} className="nav-link"> Ingrédient </Link></li>
              <li><Link to={'/freezebee'} className="nav-link">Freezebee</Link></li>
              <li><Link to={'/fabrication'} className="nav-link">Procédé de fabrication</Link></li>
            </ul>
          </nav>
          <hr />
          <h2>Bienvenu sur KillerBee</h2>
          <hr />
          <Switch>
            <Route exact path='/ingredient' component={Ingredient} />
            <Route path='/freezebee' component={FreezeBee} />
            <Route path='/fabrication' component={Fabrication} />

          </Switch>
      </Router>
    );
  }
}

export default App;
